import styled from "styled-components";

export const Wrapper = styled.div`
  text-align: center;
  width: 100%;
  position: absolute;
  top: 7.06rem;
`;

export const WakeupBox = styled.div`
  display: inline-block;
  height: 6.25rem;
  width: 21.875rem;
  border: 1px solid white;
  border-radius: 12px;
  background: #2d293d;
`;

export const SleepingComent = styled.div`
  margin-left: 12px;
  margin-top: 10px;
`;

export const SleepingHour = styled.span`
  color: #ffd954;
`;

export const NickNameText = styled.span`
  color: #fff;
  font-size: 15px;
  font-style: normal;
  font-weight: 500;
  line-height: normal;
  letter-spacing: -0.24px;
  margin-top: 10px;
`;

export const Text = styled.span`
  color: #fff;
  font-size: 18px;
  font-style: normal;
  font-weight: 500;
  line-height: normal;
  letter-spacing: -0.32px;
`;

export const WakeupSetting = styled.div`
  display: inline-flex;
  align-items: center;
  gap: 4px;
  width: 113px;
  height: auto;
  position: relative;
  right: 12px;
  bottom: 11px;

  span {
    color: var(--gray-4, #dbdbdb);
    font-size: 12px;
    font-style: normal;
    font-weight: 300;
    line-height: normal;
    letter-spacing: -0.24px;
  }
`;
